errorTimes = 0

@app.route('/cruz')
def cruz():
    while True:
        try:
            with sr.Microphone() as source2:
                recog.adjust_for_ambient_noise(source2, duration=0.2)
                audio2 = recog.listen(source2)
                command = recog.recognize_google(audio2)
                command = command.lower()
                print(command)
                sleepTime = process.execute(command)
                if sleepTime != None:
                    sleep(sleepTime)

        except sr.RequestError as e:
            process.voice({
                "data": "request failed check internet",
                "rate": 0
            })
            sleep(2)

        except sr.UnknownValueError:
            global errorTimes
            if errorTimes == 3:
                errorTimes = 0
                process.voice({
                    "data": "i cant understand",
                    "rate": 0
                })
                sleep(2)
            errorTimes += 1

        except:
            break


